// DfeServiceServer is the server API for DfeService service.
type DfeServiceServer interface {
	UserActionRecord(context.Context, *UserActionRequest) (*UserActionResponse, error)
	// Get information of the DEx market.
	// 每次可以获取某个指定链的配置，返回时处理为各个交易区。
	GetMarket(context.Context, *GetMarketRequest) (*GetMarketResponse, error)
	// Get trading config of the market.
	GetTradingConfig(context.Context, *GetTradingConfigRequest) (*GetTradingConfigResponse, error)
	// Get information of trading pairs with the given cash token id.
	GetPairsByCash(context.Context, *GetPairsByCashRequest) (*GetPairsByCashResponse, error)
	// Get metadata of token with the given token id. if token id is not pass, return all token metadata
	// metadata include: tags, description, initPrice, totalAmount, circulation, website etc.
	GetTokenMetadata(context.Context, *GetTokenMetadataRequest) (*GetTokenMetadataResponse, error)
	// Get information of a trading pair.
	GetPairInfo(context.Context, *GetPairInfoRequest) (*GetPairInfoResponse, error)
	// Get the current depth of a trading pair.
	GetDepth(context.Context, *GetDepthRequest) (*GetDepthResponse, error)
	// Get the balances of all tokens of the current trader address.
	GetBalances(context.Context, *GetBalancesRequest) (*GetBalancesResponse, error)
	// Get the active orders of the current trader address.
	GetActiveOrders(context.Context, *GetActiveOrdersRequest) (*GetActiveOrdersResponse, error)
	// Get the past (i.e. no long active) orders of the current trader address.
	GetPastOrders(context.Context, *GetPastOrdersRequest) (*GetPastOrdersResponse, error)
	// Get order via order id.
	GetOrderById(context.Context, *GetOrderByIdRequest) (*GetOrderByIdResponse, error)
	// Get trade records of the current trader address.
	GetTrades(context.Context, *GetTradesRequest) (*GetTradesResponse, error)
	// Get order execution history. This is NOT specific to a trader.
	GetTradeHistory(context.Context, *GetTradeHistoryRequest) (*GetTradeHistoryResponse, error)
	// Get transfer records of the current trader address.
	GetTransfers(context.Context, *GetTransfersRequest) (*GetTransfersResponse, error)
	PlaceOrder(context.Context, *PlaceOrderRequest) (*PlaceOrderResponse, error)
	ContraTrade(context.Context, *ContraTradeRequest) (*ContraTradeResponse, error)
	CancelOrder(context.Context, *CancelOrderRequest) (*CancelOrderResponse, error)
	CancelAllOrders(context.Context, *CancelAllOrdersRequest) (*CancelAllOrdersResponse, error)
	Withdraw(context.Context, *WithdrawRequest) (*WithdrawResponse, error)
	// authenticate with user credentials
	Authenticate(context.Context, *AuthenticateRequest) (*AuthenticateResponse, error)
	// 钱包SimpleWallet协议回调。
	SimpleWalletCallback(context.Context, *SimpleWalletCallbackRequest) (*SimpleWalletCallbackResponse, error)
	// 钱包SimpleWallet协议回调。
	GetSimpleWalletRecord(context.Context, *GetSimpleWalletRecordRequest) (*GetSimpleWalletRecordResponse, error)
	// Get kline bar of symbol with the given resolution and time period.
	GetKlineHistory(context.Context, *GetKlineHistoryRequest) (*GetKlineHistoryResponse, error)
	// Get kline configuration
	GetKlineConfig(context.Context, *GetKlineConfigRequest) (*GetKlineConfigResponse, error)
	// Get kline symbol info.
	GetKlineSymbols(context.Context, *GetKlineSymbolInfoRequest) (*GetKlineSymbolInfoResponse, error)
	GetChainInfo(context.Context, *GetChainInfoRequest) (*GetChainInfoResponse, error)
	GetBannerCampaigns(context.Context, *GetBannerCampaignsRequest) (*GetBannerCampaignsResponse, error)
	GetNotifications(context.Context, *GetNotificationsRequest) (*GetNotificationsResponse, error)
	GetServerTime(context.Context, *GetServerTimeRequest) (*GetServerTimeResponse, error)
	// Get trade records of the current trader address.
	GetTokenBalances(context.Context, *GetTokenBalancesRequest) (*GetTokenBalancesResponse, error)
	// Get trade records of the current trader address.
	GetCoinPrice(context.Context, *GetCoinPriceRequest) (*GetCoinPriceResponse, error)
	GetAppInfo(context.Context, *GetAppInfoRequest) (*GetAppInfoResponse, error)
}

